import styled from '@emotion/styled'

export const HeaderItem = styled.span`
  font-family: 'Fira Mono', monospace;
  font-size: 16px;
  color: #FFF;
  letter-spacing: 1.25px;
  text-align: center;
  line-height: 16px;
`
